import axios from "axios";

const feature = (url, method, type = "json", data) =>
  new Promise((resolve, reject) => {
    switch (method) {
      case "get":
        axios
          .get(url, { responseType: type })
          .then((res) => resolve(res.data))
          .catch((err) => reject(err));
        break;
      case "post":
        axios({ url, method, data })
          .then((res) => resolve(res.data))
          .catch((err) => reject(err));
        break;
      case "put":
        resolve("nice3");
        break;
      case "delete":
        resolve("nice4");
        break;
      default:
        resolve("nice5");
        break;
    }
  });
export default feature;
